                  aria-describedby="keep-mounted-modal-description"
                >
                  <Box
                    sx={{
                      position: "absolute",
                      top: "50%",
                      left: "50%",
                      transform: "translate(-50%, -70%)",
                      width: 600,
                      bgcolor: "background.paper",
                      boxShadow: 24,
                      p: 4,
                      borderRadius: 5,
                      border: "1px solid #E5E5E5",
                      textAlign: "center",
                    }}
                  >
                    <img src={logo} alt="Logo" style={{ width: 100 }} />
                    <Typography
                      id="keep-mounted-modal-description"
                      sx={{ mt: 2, fontWeight: 700 }}
                    >
                      Terms and Conditions
                    </Typography>
                    <Typography
                      id="keep-mounted-modal-description"
                      sx={{
                        mt: 2,
                        textAlign: "left",
                        overflowY: "auto",
                        height: 125,
                      }}
                    >
                      The company agrees to provide truthful information. and
                      can receive translation work and forward it to translators
                      who are competent in the languages stated by the company
                      above. and will be responsible for all translation works
                      translated from the company
                    </Typography>
                    <div
                      style={{
                        textAlign: "left",
                        borderTop: "1px solid #C4C4C4",
                      }}
                    >
                      <FormControlLabel
                        control={
                          <Checkbox
                            checked={checked2}
                            onChange={handleChange2}
                            inputProps={{ "aria-label": "controlled" }}
                          />
                        }
                        label="accept the terms and conditions"
                      />
                    </div>
                    <div>
                      {checked2 === false ? (
                        <button
                          style={{
                            width: "30%",
                            borderRadius: 20,
                            background: "#E0E0E0",
                            height: 40,
                            color: "#FFFFFF",
                            fontSize: 18,
                            borderColor: "transparent",
                            position: "relative",
                            left: "35%",
                          }}
                          disabled
                          onClick={handleOpen}
                        >
                          Submit
                        </button>
                      ) : (
                        <button
                          style={{
                            width: "30%",
                            borderRadius: 20,
                            background: "#001E33",
                            height: 40,
                            color: "#FFFFFF",
                            fontSize: 18,
                            borderColor: "transparent",
                            position: "relative",
                            left: "35%",
                          }}
                          onClick={handleClose4}
                        >
                          Submit
                        </button>
                      )}
                    </div>
                  </Box>
                </Modal>

                <Modal
                  keepMounted
                  open={open4}
                  onClose={handleClose5}
                  aria-labelledby="keep-mounted-modal-title"
                  aria-describedby="keep-mounted-modal-description"
                >
                  <Box
                    sx={{
                      position: "absolute",
                      top: "50%",
                      left: "50%",
                      transform: "translate(-50%, -70%)",
                      width: 400,
                      bgcolor: "background.paper",
                      boxShadow: 24,
                      p: 4,
                      borderRadius: 5,
                      border: "1px solid #E5E5E5",
                      textAlign: "center",
                    }}
                  >
                    <AiFillCheckCircle
                      style={{ width: 100, height: 80, color: "#46BC52" }}
                    />
                    <Typography
                      id="keep-mounted-modal-description"
                      sx={{ mt: 2, fontWeight: 700 }}
                    >
                      Your translator application has been sent. Wait for
                      confirmation by email
                    </Typography>
                  </Box>
                </Modal>
              </div>
            </div>
          ) : null}

          <div style={{ top: "95%", position: "absolute", marginLeft: "25%" }}>
            <div style={{ float: "right" }}>
              <p>Privacy policy</p>
            </div>
            <div style={{ float: "right", marginRight: 50 }}>
              <p>Copyrights Give Network 2021.</p>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};
export default Signup;
